import React from 'react';
import Fade from 'react-reveal/Fade';
import './FFNav.css';

export default function FFNav() {
  return (
    <Fade right duration={100}>
      <aside>
        <nav className="side-menu">
          <h2>Menu</h2>
          <h4>Item 1</h4>
          <h4>Item 2</h4>
        </nav>
        <div className="timer-container">
          <h3>Time</h3>
        </div>
      </aside>
    </Fade>
  )
}
